// Set up some colours to use in this file (consult style guide)
const myColours = {
  colour1       : '#008B8B',
  colour2       : '#20B2AA',
  colour3       : '#1E90FF',
  roiRed        : '#941a1d',
  roiCharcoal   : '#262626',
  roiGrey       : '#595959',
  roiWhite      : '#ffffff',
  roiBurntOrange: '#c64c38',
  roiLightOrange: '#cb6d4f',
  roiMidGrey    : '#3b3b3b',
  roiLightGrey  : '#D9D9D9',
};

// Export all the colours used by the app
export default {
  tabBar           : myColours.roiCharcoal,
  tabIcon          : 'white',
  tabIconSelected  : myColours.roiBurntOrange,
  tabLabel         : 'white',
  tabLabelSelected : myColours.roiBurntOrange,
  errorBackground  : 'red',
  errorText        : '#fff',
  warningBackground: '#EAEB5E',
  warningText      : '#666804',
  noticeBackground : myColours.roiCharcoal,
  noticeText       : '#fff',
  roiRed           : myColours.roiRed,
  roiCharcoal      : myColours.roiCharcoal,
  roiGrey          : myColours.roiGrey,
  roiWhite         : myColours.roiWhite,
  roiBurntOrange   : myColours.roiBurntOrange,
  roiLightOrange   : myColours.roiLightOrange,
  roiMidGrey       : myColours.roiMidGrey,
  roiLightGrey     : myColours.roiLightGrey,
};

